import Head from "next/head";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
const Header = () => {
  <dir>
    <Head>new web</Head>
    <Navbar fixed="top" collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Navbar.Brand href="/">GG</Navbar.Brand>
      <Navbar.Toggle arin-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="esponsive-navbar-nav">
        <Nav>
          <NavDropdown>
            <NavDropdown.Item href="/business">Business</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="/technology">Technology</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  </dir>;
};
export default Header;
